import React from "react";

export default function Skills() {
  const skills = ["React", "JavaScript", "Node.js", "MongoDB", "CSS", "Git"];

  return (
    <section id="skills" className="p-5 bg-white dark:bg-gray-800 text-gray-900 dark:text-white">
      <h2 className="text-3xl font-bold mb-4">Skills</h2>
      <ul className="flex flex-wrap gap-2">
        {skills.map((skill) => (
          <li
            key={skill}
            className="px-4 py-2 bg-gray-200 dark:bg-gray-700 text-gray-800 dark:text-gray-200 border border-gray-300 dark:border-gray-600 rounded-full"
          >
            {skill}
          </li>
        ))}
      </ul>
    </section>
  );
}
